import './Home.css';
import Logo from './images/Logo2.png';
import { useEffect } from 'react';

export default function Home() {
    useEffect(() => {
        const handleScroll = () => {
          const introDiv = document.querySelector('.intro');
          const scrollPosition = window.pageYOffset || document.documentElement.scrollTop;
          const triggerHeight = window.innerHeight / 2; // Adjust this value to change the trigger point
    
          if (scrollPosition > triggerHeight) {
            introDiv.classList.add('show');
          } else {
            introDiv.classList.remove('show');
          }
        };
    
        window.addEventListener('scroll', handleScroll);
        return () => {
          window.removeEventListener('scroll', handleScroll);
        };
      }, []);
    
    return (
        <>
            <nav class="navbar navbar-expand-lg bg-body-tertiary">
                <div class="container-fluid">
                    <a class="navbar-brand" href="#"><img className='glowing-logo' src={Logo} width='80px' alt='DelishDash'></img></a>
                    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span class="navbar-toggler-icon"></span>
                    </button>
                    <div class="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                            <li class="nav-item">
                                <a class="nav-link active" aria-current="page" href="#">Home</a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link" href="#">Link</a>
                            </li>
                            <li class="nav-item dropdown">
                                <a class="nav-link dropdown-toggle" href="#" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                                    Dropdown
                                </a>
                                <ul class="dropdown-menu">
                                    <li><a class="dropdown-item" href="#">Action</a></li>
                                    <li><a class="dropdown-item" href="#">Another action</a></li>
                                    <li><hr class="dropdown-divider" /></li>
                                    <li><a class="dropdown-item" href="#">Something else here</a></li>
                                </ul>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link disabled" aria-disabled="true">Disabled</a>
                            </li>
                        </ul>
                        <form class="d-flex" role="search">
                            <input class="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
                            <button class="btn btn-outline-success" type="submit">Search</button>
                        </form>
                    </div>
                </div>
            </nav>
            <div className="firstbanner .container-fluid">
                <div className='intro'>
                    <h1>DelishDash</h1><br />
                    <h2>Welcome to our culinary haven, where high-quality food products meet exceptional convenience and inspire your kitchen creativity.</h2><br />
                    <button type="button" class="btn btn-primary">Explore More</button>
                </div>
            </div>
            <div></div>
        </>
    );
}
